script: |
  super -f text -I q12573.spq | sort > q12573.out

inputs:
  - name: q12573.spq
    data: |
      SELECT ALL + 94 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - - ( + - ( + col1 ) ) ) BETWEEN - 35 AND - col1 * + col0 * - col1 + col2 * + col1 + - + col1;
  - name: tab1

outputs:
  - name: q12573.out
    data: |
      94
      94
